import "./App.css";
import Form from "./components/Form";
import Table from "./components/Table";
import { EntryProvider } from "./context/TableContext";
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <h1>Hello World!</h1>

      <ul>
       <Link to="/"><li>home</li></Link> 
       <Link to="/test1"><li>test 1</li></Link> 
       <Link to="/test2"><li>test 2</li></Link> 
      </ul>
      <EntryProvider>
        <Form />
        <Table />
      </EntryProvider>
    </div>
  );
}

export default App;
